import React from 'react'
import MOVER from './Images/movers.png'

class App extends React.Component {

	render() {
		return (
			<div style={{position: 'absolute', top: 0, right: 0, left: 0}}>
				<div style={{position: 'relative'}}>
					<div style={{height: '10vh', width: '100vw', top : 0, left: 0, right: 0, position: 'absolute', borderBottom: '0.5px solid black', display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'space-evenly'}}>
						<b>Coucou</b>
						<b>Coucou</b>
						<b>Coucou</b>
					</div>
					<div style={{height: '70vh', width: '100vw', display: 'flex', alignItems: 'center', justifyContent: 'center', marginTop: '10vh', left: 0, position: 'absolute', backgroundImage: 'url(' + MOVER +')', backgroundPosition: 'center', backgroundSize: 'cover'}}>
						<div style={{display: 'flex', flex: 7}}><b>Hello</b></div>
						<div style={{display: 'flex', flex: 3}}><b>Hello</b></div>
					</div>
				</div>
			</div>
		);
	}
}

export default App;
